import React from 'react'

const DogList = ({dogs}) => {
    console.log(dogs)
    return(
    <>
        <h1>Dog List</h1>
        {dogs.map(dog => 
        // <h1>{dog.name}</h1>
        <img src={`.../public/${dog.src}.jpg`} alt='image of dog'></img>
        )}
    </>
    )
}

export default DogList;
